import * as yup from 'yup';

const validations = yup .object().shape({
    email: yup.string().email('Please enter valid email').required("Mandatory"),
    password: yup.string().min(5, "At least 5 character needs").required(),
    passwordConfirm: yup.string().oneOf([yup.ref("password")], "Password needs to matched"),

});

export default validations;
